import styles from "./app.module.css";
import { data } from "../../utils/data";
import { Logo,BurgerIcon,ListIcon,ProfileIcon } from '@ya.praktikum/react-developer-burger-ui-components'


function App() {
  return (
    <div className={styles.app}>
      <pre style={{
      	margin: "auto",
      	fontSize: "1.5rem"
      }}>
      	Измените src/components/app/app.jsx и сохраните для обновления.
      </pre>
    </div>
  );
}

function AppHeader() {
    return (
      <div className={styles.header}>
        <div className={styles.header}>
          <BurgerIcon className="pl-2 pr-5 "/>
          <div className="text text_type_main-small pl-2 pr-5 ">Конструктор</div>
        </div>
        <div>
          <ListIcon />
          <div className="text text_type_main-default text_color_inactive pl-5 ml-2 mt-4 mb-4 pr-5">Лента заказов</div>
        </div>
        <Logo />
        <div>
          <ProfileIcon />
          <div className="text text_type_main-default text_color_inactive pl-5 mt-4 mr-2 mb-4 pr-5">Личный кабинет</div>
        </div>
      </div>
    );
}

export default AppHeader;
